import React from 'react';

function DietObesity3() {
  return (
    <div className="diet-page">
      <h1>Diet for Obesity Level 3</h1>
      <p>For Obesity Level 3, a comprehensive approach to diet and health is necessary:</p>
      <ul>
        <li>Adopt a very low-calorie, high-nutrient diet with supervision from a healthcare provider.</li>
        <li>Focus on foods with high fiber content and lean proteins.</li>
        <li>Minimize consumption of high-fat and sugary foods.</li>
        <li>Incorporate physical activity tailored to your health status.</li>
        <li>Regularly monitor progress with a healthcare professional and adjust your plan as needed.</li>
      </ul>
    </div>
  );
}

export default DietObesity3;
